sys_variable_value.value:
(function execute(inputs, outputs) {
	var url = '';
	var record = inputs.record;
  	var table = inputs.table;
	var baseURL = gs.getProperty('glide.servlet.uri');
  	url = baseURL + table + '.do?sys_id=' + record;
  	outputs.url = url;
})(inputs, outputs);

